import React, { Component } from 'react'

export default class Footer extends Component {
  render() {
    return (
        <div id="footer" class="bg-primary">
        <div class="container">

            <p class="text-white text-center"> Adi Wawan &copy; 2020</p>

        </div>
    </div>
    )
  }
}
